import React from "react";
import {NavBlock, NavListItem} from "./styles";

const navItem = [
    {
        mainMenu: "아이템1",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템2",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템3",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    },
    {
        mainMenu: "아이템4",
        subMenu: [
            {
                name: "상품1",
                path: "#"
            },
            {
                name: "상품1",
                path: "#"
            }]
    }
];

const Nav = () => {
    return (
        <NavBlock>
            {navItem.map( item => (
                <NavListItem>{item.mainMenu}</NavListItem>
            ))}
        </NavBlock>
    )
};
export default Nav
